import { useAuth0 } from '@auth0/auth0-react';
import { useEffect } from 'react';
import { Header as HeaderStyle } from './header.styled'


const Header = () => {

    const { loginWithRedirect, isAuthenticated } = useAuth0();


    useEffect(() => {
        if (!isAuthenticated)
            loginWithRedirect()
    }, [isAuthenticated])

    return (
        <HeaderStyle>

        </HeaderStyle>
    )
}

export default Header
